import React from 'react';

export default function Functions () {
    return (
        <div className='Home__Functions--container'>
            <div className='Home__Functions--header'>
                <div className='Home__Functions--header--1'>Choose game</div>
                <div className='Home__Functions--header--2'>Gather players</div>
                <div className='Home__Functions--header--1'>Fix place and date</div>
                <div className='Home__Functions--header--2'>Reserve table</div>
            </div>
            <div className='Home__Functions--description'>
                <div className='Home__Functions--description--1'>Pick type and title</div>
                <div className='Home__Functions--description--2'>Pick number and level of players</div>
                <div className='Home__Functions--description--1'>Decide where and when to play</div>
                <div className='Home__Functions--description--2'>Book room for your game</div>
            </div>
        </div>
    );
};
